import React from 'react';
import s from './NavBar.module.css'
import { NavLink, Route } from 'react-router-dom';



const NavBar = () => {
    return (
            <div class={s.sidenav}>
                <NavLink className={s.link} to="/numeric">Переменные</NavLink>
                <NavLink className={s.link} to="/introduction">Типы данных</NavLink>
                <NavLink className={s.link} to="/introduction">Переназначение данных</NavLink>
                <NavLink className={s.link} to="/introduction">Переменные</NavLink>
                <Route path='/numeric' render={() => <About />} />

            </div>
    );
}

export default NavBar;
